import React, { Component } from 'react'
import { Button, Container, Divall, FlexContainer, InputSearch } from './Todo'

export default class extends Component {
  constructor(props) {
    super(props)
    this.state = {
      data: [],
      modal: false,
    }
  }
  render() {
    return (
      <Container>
        <FlexContainer>
          <InputSearch type={'text'} placeholder={'Search'} widthh />
          <Button onClick={() => this.setState({ modal: !this.state.modal })}> + New User  </Button>
        </FlexContainer>
        <Divall open={this.setState.modal}>
          {this.state.modal === true && <FlexContainer >
            <InputSearch placeholder='Firstname' />
            <InputSearch placeholder='Lastname' widthh />
            <InputSearch placeholder='Address' />
          </FlexContainer>}
        </Divall>
      </Container>
    )
  }
}
